import React from 'react';

const Achievements = () => {
    return (
        <div className='achievements centered-container'>
            <p>Finalist in the Bioinformatics Contest 2021, showcasing expertise in the field.</p>
            <p>CodeChef: Solved 700 problems, demonstrating strong problem-solving skills.</p>
            <p>LeetCode: Completed 245 problem-solving challenges and earned the 100 Days Badge in 2022.</p>
        </div>
    );
}

export default Achievements;
